import { Injectable } from '@angular/core';
import { Storage } from '@ionic/storage-angular';

const STORAGE_KEY = "mylist";

@Injectable({
  providedIn: 'root'
})
export class StorageService {

  constructor(private storage: Storage) {
    this.init();
  }

  init(){
    this.storage.create();
  }

  getData(){
    return this.storage.get(STORAGE_KEY) || [];
  }
}
